import axios from "axios";
const API_URL = "https://api.enviosuramerica.com/services-web/tracking-guia";

export const trackingGuide = async (guia: string) => {
  try {
    const response = await axios.post(
      API_URL,
      { guia },
      {
        withCredentials: true,
        headers: {
          "Content-Type": "application/json",
          "Access-Control-Allow-Credentials": "true",
          "Cache-Control": "no-cache",
        },
      }
    );
    return response.data.mensaje;
  } catch (err) {
    console.error("Error al recibir la solicitud", err);
    throw err;
  }
};
